import './App.css';

function App() {
  return (
    <div className="container">
    <nav className="nav1">
            <ul >
                <li><a href="">Home</a></li>
                <li><a href="">About</a></li>
                <li><a href="">Contact Us</a></li>
                <li><a href="">Help</a></li>
                <li><button className="login-btn">Login</button></li>
            </ul>
        </nav>
        </div>
  );
}

export default App;
